import React, { Fragment } from "react";
import { 
    BrowserRouter as Router, 
    Routes,
    Route, 
    Navigate
  } from "react-router-dom";
import MenuCategories from "./MenuCategories";

const Menu = () => {
    return (
        <Fragment>
            <Router>
                <div className="container">
                <Routes>
                    <Route 
                    path="/menu/drinks/:drinkType"
                    />
                    <Route 
                    path="/register" 
                    element={
                        !isAuthenticated ? (
                        <Register setAuth={setAuth}/>
                        ) : (
                        <Navigate to="/login" />
                        )
                    }
                    />
                    <Route 
                    path="/dashboard" 
                    element={
                        isAuthenticated ? (
                        <Dashboard setAuth={setAuth}/>
                        ) : (
                        <Navigate to="/login" />
                        )
                    }
                    />
                    <Route 
                    path="/menu" 
                    element={<Menu />}
                    />
                </Routes>
                </div>
            </Router>
            <h1>Menu</h1>
            <MenuCategories />
        </Fragment>
    );
}

export default Menu;
